C = C_*R0;
s = surf(x,y,z, C); 
shading interp; axis equal tight;

 caxis(clim);                    % Achsen-CLim fixieren
 cbar.Limits = clim;             % Farbleiste fixieren (konsistent
 %%
% % --- Beschriftung der Farbleiste ---
% light
% lighting gouraud
 view(300,30)
 camzoom(1.95)
cbar = colorbar('southoutside');
 cbar.Label.String = 'Mean curvature $\frac{1}{2}\kappa$';
 cbar.Label.Interpreter = 'latex';
 cbar.Label.FontSize = 40;
 % Schriftgröße der Zahlen (Ticks) ändern:
cbar.FontSize = 40;
% grid on; grid minor
 zlabel('$z$', 'FontSize', 20, 'Interpreter', 'latex', 'Rotation', 0)
 ylabel('$y$', 'FontSize', 20, 'Interpreter', 'latex')
 xlabel('$x$', 'FontSize', 20, 'Interpreter', 'latex')
 axis([-0.5 0.5 -0.5 0.5 -0.5 0.5]./R0)
 hold on
 g = mesh(x, y, z);                     % nur Linien, keine Fläche
 set(g, 'FaceColor','none', ...
        'EdgeColor',[0.2 0.2 0.2], ...
        'LineWidth',0.01);
axis off
box off
grid off
set(gcf, 'Color', 'white')
 %% Plot Size and Saving as esp

cd '..\..\Plots\Code'
s0 = '..\Figures\';
format = '.png';  % oder '.pdf', '.eps'
s = strcat(s0, s1, Name, '_', TimeStep, '_', s3, format);
exportgraphics(gcf, s, 'Resolution', 600);

